import React from "react";
import { useEffect, useState } from "react";

function AllProdPage() {
  const [products, setProducts] = useState([]);

  useEffect(() => {
    fetch("http://localhost:4000/getProducts")
      .then((res) => res.json())
      .then((data) => {
        setProducts(data);
      });
  }, []);

  return (
    <div>
      {products.map((x, i) => (
        <div>{x}</div>
      ))}
    </div>
  );
}

export default AllProdPage;
